window.bookSummaryJSON = "In investigating the poisoning of a young man in a bookshop at the Eastern Market, and the wrongful arrest of one Miss Sylvia Lee, Phryne Fisher is plunged into a world of Jewish politics, alchemy, poison, and chicken soup. <p>Stopping only for a brief but intensely erotic dalliance with the beautiful Simon Abrahams, Phryne picks her way through the mystery with help from the old faithfuls: Bert, Cec, Dot, and Detective Inspector \"Call Me Jack\" Robinson. But ultimately it is her stealth and wit that solve the crime - and all for the price of a song....</p>"; 
